import React from 'react';
import logo from './logo.svg';
import './App.css';

const name = "Tanya Goel";
const day = new Date();
var hr = day.getHours();

let greeting="";
if (hr >= 0 && hr < 12) {
  greeting="Good Morning!";
} else if (hr == 12) {
  greeting="Good Noon!";
} else if (hr >= 12 && hr <= 17) {
  greeting="Good Afternoon!";
} else {
  greeting="Good Evening!";
}
function App() {

  return (
    <div className="text">
      <h1>Hi Sir, {greeting}</h1>
      <div className="img_div">
      </div>
    </div>
  );
}
export default App;
